import { Stack } from "react-bootstrap";
import { Link } from "react-router-dom";

function Footer() {
  return (
    <Stack
      direction="horizontal"
      className="footer mt-2"
      gap={{ xs: 3, md: 4, xl: 5 }}
    >
      <Link to="about-us" className="footer-item">
        About Us
      </Link>
      <Link to="/contact" className="footer-item">
        Contact
      </Link>
      <Link to="/faqs" className="footer-item">
        FAQs
      </Link>
      <Link to="/terms-and-conditions" className="footer-item">
        Terms & Conditions
      </Link>
    </Stack>
  );
}

export default Footer;
